 `=`, `&`, `"` and `'` are special characters in XML.  You need to escape them using their corresponding XML entities:

*   `&` becomes `&amp;`
*   `>` becomes `&gt;`
*   `<` becomes `&lt;`
*   `"` becomes `&quot;`
*   `'` becomes `&apos;`

